const BrendItem = ({ list }) => {
  return (
    <>
      {list.map(({ linkItem, img  }, index) => {
        return(
          <li className="uzi__list-item" key={index}>
            <a href={linkItem} className="uzi__item-pict">
              {img}
            </a>
            <h5 className="uzi__item-from">{from}</h5>
            <h2 className="uzi__item-title">{model}</h2>
            <h3 className="uzi__item-subtitle">УЗ аппарат экспертного класса</h3>
            <ul className="uzi__description-list">
              <li className="uzi__description-item">20 поддерживаемых датчиков, 4 порта</li>
              <li className="uzi__description-item">Функция Auto Doppler для сосудов</li>
              <li className="uzi__description-item">Поддержка датчиков с монокристаллической технологией</li>
              <li className="uzi__description-item">Функция количественного анализа бляшек (VPQ)</li>
              <li className="uzi__description-item">Анализ деформации миокарда (SQ)</li>
              <li className="uzi__description-item">Визуализация с контрастированием (CEUS)</li>
              <li className="uzi__description-item">Функция реалистичного отображения ребенка</li>
              <li className="uzi__description-item">Cкладывающийся 21,5" ЖК-монитор</li>
            </ul>
            <button id="order-btn" className="uzi__order-btn"><a href="#mail" className="uzi__item-link">Заказать</a></button>
          </li>
        )
      })}
    </>
  )
}

export default BrendItem
